function submitAjaxRequest(url,datas,doneCallback){$.ajax({url:url,type:"POST",dataType:"json",data:datas,timeout:5e3,error:function(){console.log("Erreur de requete !");console.log("URL=> "+url);console.log("TYPE=> POST / json");console.log("data=> "+datas)}}).done(function(resp){doneCallback(resp)})}